import React from "react";

function Card(props) {
    const [isAdded, setIsAdded] = React.useState(false);

    const onClickPlus = () => {
        setIsAdded(true);
    }

    console.log(isAdded);

    return(
        <div className="card">
            <div className="favorite">
                <img onClick={props.onFavorite} src="/img/unliked.svg" />
            </div>
             <img width={133} height={112} src={props.imageUrl}/>
            <p>{props.title}</p>
            <div className="card-inner">
                <div className="card-price">
                  <p>Цена:</p>
                  <b>{props.price} руб.</b>
                </div>
                <button  onClick={onClickPlus}>
                     <img width={11} height={11} src={isAdded ? '/img/cheked.svg' : '/img/plus.svg'} /> 
                </button>
            </div>
        </div>
    );
}

export default Card
